import React from "react";
import Button from "reactstrap";

const DisplayWord = (props) => {
  console.log("word");
  console.log(props.word);
  return (
    <div>
      <h2>{props.word.meta.stems[0]}</h2>
      <Button
        type="primary"
        onClick={() => {
          this.postToDB(this.props);
        }}
      >
        Save Book
      </Button>
    </div>
  );
};

export default DisplayWord;
